import React from 'react';
import './Bio.css';

const Bio = () => {
  return (
<div>
  <div className="navbar">Bio</div>
  <p className="bio">MS Nickki est une "blueswoman" née a Holly Springs (Mississippi), berceau de la musique noire américaine dont elle est une représentante aujourd'hui. Elle vous envoie sur la planète "Blues" avec un talent vocal impressionnant et un charme naturel qui ne peut vous laisser insensible... MS Nickki chante un blues profond alliant la puissance du gospel (répertoire qu'elle connaît particulièrement) et la douceur de la soul: une alchimie musicale typique de Memphis, Tennessee, cette immense ville au riche passé musical dans laquelle elle réside depuis une dizaine d'années. Ses influences majeures sont des chanteuses telles Denise LaSalle, Aretha Franklin, Tina Turner, Barbara Carr et des chanteurs originaire de Memphis tels que Johnnie Taylor et Al Green.</p>
  <p className="combo_bio"></p>
  </div>
  )
}

export default Bio;
